INSERT INTO authors (id, name, slug, bio) VALUES (44352, 'Walter Lewin', 'walter-lewin', 'Bio unavailable'), (44353, 'Kion Ahadi', 'kion-ahadi', 'Bio unavailable'), (44354, 'Angie Smibert', 'angie-smibert', 'Bio unavailable'), (44355, 'so why dare to drag some negative burdens along?', 'so-why-dare-to-drag-some-negative-burdens-along', 'Bio unavailable'), (44356, 'mostly for the purpose of making others bow down to them. But I fight tirelessly to inspire my fellow humans to become Kings and Queens in their own worlds.', 'mostly-for-the-purpose-of-making-others-bow-down-to-them-but-i-fight-tirelessly-to-inspire-my-fellow-humans-to-become-kings-and-queens-in-their-own-worlds', 'Bio unavailable'), (44357, 'dare to be extraordinarily great.', 'dare-to-be-extraordinarily-great', 'Bio unavailable'), (44358, 'working smart guarantees your success.', 'working-smart-guarantees-your-success', 'Bio unavailable'), (44359, 'your inner positive fulfillment doesn''t depend on them.', 'your-inner-positive-fulfillment-doesn-t-depend-on-them', 'Bio unavailable'), (44360, 'the future already has its challenging demands.', 'the-future-already-has-its-challenging-demands', 'Bio unavailable'), (44361, 'yet most people spend a lifetime unable to experience it.', 'yet-most-people-spend-a-lifetime-unable-to-experience-it', 'Bio unavailable'), (44362, 'his mental programming determines his personality.', 'his-mental-programming-determines-his-personality', 'Bio unavailable'), (44363, 'so why even bother with them?', 'so-why-even-bother-with-them', 'Bio unavailable'), (44364, 'one''s mental programming does.', 'one-s-mental-programming-does', 'Bio unavailable'), (44365, 'not an occasional or constant competition with others.', 'not-an-occasional-or-constant-competition-with-others', 'Bio unavailable'), (44366, 'try not to make yours permanent in your life.', 'try-not-to-make-yours-permanent-in-your-life', 'Bio unavailable'), (44367, 'so why waste your time and energy trying to impress them?', 'so-why-waste-your-time-and-energy-trying-to-impress-them', 'Bio unavailable'), (44368, 'it just leads to more curiosities that lead to a greater mind.', 'it-just-leads-to-more-curiosities-that-lead-to-a-greater-mind', 'Bio unavailable'), (44369, 'they can only make me stronger.', 'they-can-only-make-me-stronger', 'Bio unavailable'), (44370, 'it is a game of willpower.', 'it-is-a-game-of-willpower', 'Bio unavailable'), (44371, 'be afraid to fail to try.', 'be-afraid-to-fail-to-try', 'Bio unavailable'), (44372, 'it only demands frequent positive interpretations of one''s experiences.', 'it-only-demands-frequent-positive-interpretations-of-one-s-experiences', 'Bio unavailable'), (44373, 'by all means don''t deprive yourself from living happily.', 'by-all-means-don-t-deprive-yourself-from-living-happily', 'Bio unavailable'), (44374, 'strive to become a better person.', 'strive-to-become-a-better-person', 'Bio unavailable'), (44375, 'so why not follow His guidance through your inner positive voices? He is the main author of your life.', 'so-why-not-follow-his-guidance-through-your-inner-positive-voices-he-is-the-main-author-of-your-life', 'Bio unavailable'), (44376, 'let''s not dare to allow anyone or anything to stop us from seizing every opportunity that today brings.', 'let-s-not-dare-to-allow-anyone-or-anything-to-stop-us-from-seizing-every-opportunity-that-today-brings', 'Bio unavailable'), (44377, 'it is available for all. Anyone can strive and become successful regardless of their gender. So stop limiting yourself from success by always depending on the success of others.', 'it-is-available-for-all-anyone-can-strive-and-become-successful-regardless-of-their-gender-so-stop-limiting-yourself-from-success-by-always-depending-on-the-success-of-others', 'Bio unavailable'), (44378, 'while others succeed by consistently learning from theirs.', 'while-others-succeed-by-consistently-learning-from-theirs', 'Bio unavailable'), (44379, 'so they can cannot see what you see in your mental imagination.', 'so-they-can-cannot-see-what-you-see-in-your-mental-imagination', 'Bio unavailable'), (44380, 'instead of by fear and doubts. Your thoughts can either keep you stagnant in life or drive you to greater heights.', 'instead-of-by-fear-and-doubts-your-thoughts-can-either-keep-you-stagnant-in-life-or-drive-you-to-greater-heights', 'Bio unavailable'), (44381, 'negative interpretations of them do.', 'negative-interpretations-of-them-do', 'Bio unavailable'), (44382, 'instead of worrying about the things that some people might think or say about it.', 'instead-of-worrying-about-the-things-that-some-people-might-think-or-say-about-it', 'Bio unavailable'), (44383, 'you just have to surprise them with a massive success story. Have you forgotten that you were born to win?', 'you-just-have-to-surprise-them-with-a-massive-success-story-have-you-forgotten-that-you-were-born-to-win', 'Bio unavailable'), (44384, 'they are abilities that you were already born with.', 'they-are-abilities-that-you-were-already-born-with', 'Bio unavailable'), (44385, 'please try not to make it permanent in your life.', 'please-try-not-to-make-it-permanent-in-your-life', 'Bio unavailable'), (44386, ''' it is upon us all through God''s guidance and protection.', 'it-is-upon-us-all-through-god-s-guidance-and-protection', 'Bio unavailable'), (44387, 'it only means that you still have the gift of life and still doing something with your life.', 'it-only-means-that-you-still-have-the-gift-of-life-and-still-doing-something-with-your-life', 'Bio unavailable'), (44388, 'rather I make friends based on how positive their minds are. It is hard to end up with a very complicated lifestyle if you are always surrounded by positive minded individuals.', 'rather-i-make-friends-based-on-how-positive-their-minds-are-it-is-hard-to-end-up-with-a-very-complicated-lifestyle-if-you-are-always-surrounded-by-positive-minded-individuals', 'Bio unavailable'), (44389, 'instead of making excuses on why they are not happening. Vow to stop complaining and start doing.', 'instead-of-making-excuses-on-why-they-are-not-happening-vow-to-stop-complaining-and-start-doing', 'Bio unavailable'), (44390, 'so you might as well do whatever pleases God and your positive inner-self and live happily thereafter.', 'so-you-might-as-well-do-whatever-pleases-god-and-your-positive-inner-self-and-live-happily-thereafter', 'Bio unavailable'), (44391, 'instead it is about living it wisely.', 'instead-it-is-about-living-it-wisely', 'Bio unavailable'), (44392, 'neither will you be the last one to do so. Please humble yourself and never treat others like they are inferior to you.', 'neither-will-you-be-the-last-one-to-do-so-please-humble-yourself-and-never-treat-others-like-they-are-inferior-to-you', 'Bio unavailable'), (44393, 'instead of allowing them to block your light to your true purpose on earth.', 'instead-of-allowing-them-to-block-your-light-to-your-true-purpose-on-earth', 'Bio unavailable'), (44394, 'you may be freeing him from being a camel.', 'you-may-be-freeing-him-from-being-a-camel', 'Bio unavailable'), (44395, 'thereafter they shape us.', 'thereafter-they-shape-us', 'Bio unavailable'), (44396, 'Jacqueline Susann', 'jacqueline-susann', 'Bio unavailable'), (44397, 'after 1565 we can be nothing but Filipino.', 'after-1565-we-can-be-nothing-but-filipino', 'Bio unavailable'), (44398, 'James R. Silvestri', 'james-r-silvestri', 'Bio unavailable'), (44399, 'Christopher John Farley', 'christopher-john-farley', 'Bio unavailable'), (44400, 'Erving Goffman', 'erving-goffman', 'Bio unavailable'), (44401, 'Tal McThenia', 'tal-mcthenia', 'Bio unavailable');
